    //Haversine formula
    var rad = function(x) {
        return x * Math.PI / 180;
    };

    var getDistance = function(p1_lat,p1_lng, p2_lat,p2_lng) {
        var R = 6378137; // Earths mean radius in meter
        var dLat = rad(p2_lat - p1_lat);
        var dLong = rad(p2_lng - p1_lng);
        var a = Math.sin(dLat / 2) * Math.sin(dLat / 2) + Math.cos(rad(p1_lat)) * Math.cos(rad(p2_lat)) * Math.sin(dLong / 2) * Math.sin(dLong / 2);
        var c = 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1 - a));
        var d = R * c;
        return d; // returns the distance in meter
    };

    //alert(getDistance(52.5773139,1.3712427,52.4788314,1.7577444));

    function get_rout(xorigins,xdestinations,text,id) {

        var service = new google.maps.DistanceMatrixService();
        var d = $.Deferred();
        service.getDistanceMatrix({
            origins: [xorigins],
            destinations: [xdestinations],
            travelMode: google.maps.TravelMode.DRIVING,
            unitSystem: google.maps.UnitSystem.METRIC,
            avoidHighways: false,
            avoidTolls: false
        }, function (response, status) {
            if (status == google.maps.DistanceMatrixStatus.OK && response.rows[0].elements[0].status != "ZERO_RESULTS") {

                //$("body").append(text + ", jarak tempuh kendaraan "+ distance +"<br>");
                //$('.distance').val(distancefinel[0]);
                d.resolve(response);
            } else {
                alert("Unable to find the distance via road.");
                d.reject(status);
            }
        });
        return d.promise();
    }

    function calcDistance(p1, p2) {
      return (google.maps.geometry.spherical.computeDistanceBetween(p1, p2) / 1000).toFixed(2);
    }

